INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (13236, 52, 'Olanzapine', 'Tardive Dyskinesia', 'Tardive dyskinesia (TD) has occurred in patients treated with antipsychotic drugs; the syndrome consists of potentially irreversible, involuntary, dyskinetic movements.  The risk appears highest in older patients (particularly older women) but it is not possible to predict which patients are likely to develop TD; whether antipsychotic drugs differ in their potential to cause TD is unknown.  The risk of TD and the likelihood that it will become irreversible increase with the duration of therapy and the total cumulative dose.  The syndrome can develop after relatively brief treatment periods, even at low dosages; it may also occur after discontinuation of therapy.  TD may remit (partially or completely) upon discontinuation of antipsychotic therapy, although antipsychotic therapy itself may suppress (or partially suppress) signs/symptoms of TD, possibly masking the underlying process; the effect of symptomatic suppression on the long-term course of TD is unknown.  In patients with preexisting drug-induced TD, initiating or increasing the dosage of antipsychotic therapy may temporarily mask the symptoms of TD but could eventually worsen the condition.  In patients requiring chronic therapy, the lowest dose and shortest duration of therapy producing a satisfactory clinical response are recommended; the need for continued therapy should be reassessed periodically.  If signs/symptoms of TD occur during antipsychotic therapy, discontinuation of the offending agent should be considered; however, some patients may require treatment despite the presence of TD.', '2', '', 'DDInter', 0);
